import React from 'react';
import styles from './Form.css';
import axios from 'axios';


let Form =() => {
   
let Submit = async () => {
    let loginData = {
         username:"xyz",
         password:"xyz"
     }
     try {
     let response = await axios.post ('http://195.242.161.52:8888/login', loginData)
     console.log(response)
     }catch (e) {
         console.log(e)
     }
     }
   
    return (
        <div className='loginForm'>
            <span>Login</span>
            <div class="form-group">
                <input type="login" class="form-control" id="InputEmail" placeholder="Login"/>
            </div>
                <div class="form-group">
                 <input type="password" class="form-control" id="InputPassword" placeholder="Password"/>
            </div>

               /*<button type="submit" class="btn btn-primary">Submit</button>*/
               <button onClick = {this.Submit} type="button" class="btn btn-info">Инфо</button>
         </div>
    )
    }
                        
export default Form;
